import React from 'react'

const HoverTarget = ({ size }) => {
    const style = {
        width: size,
        height: size,
        position: 'absolute',
        top: 0,
        left: 0
    };

    return (
        <div style={style}>
        </div>
    )
}

export default HoverTarget
